import React, { Component } from "react";

class Rank extends Component {
    render() {
        return (
            <div>
                <div className='white f3'>
                    {'Hyeju, your current rank is...'}
                </div>
                <div className='white f1'>
                    {'#5'}
                </div>
            </div>
        );
    }
}

export default Rank;
